// Filename: ContactInfoTable.jsx

import React from 'react';

function ContactInfoTable({ data }) {
  if (!data?.registrant) return null;

  return (
    <div className="overflow-x-auto w-full">
      <table className="w-full table-fixed text-sm bg-white text-black">
        <thead className="bg-gray-300">
          <tr>
            <th className="border px-4 py-2">Registrant Name</th>
            <th className="border px-4 py-2">Technical Contact Name</th>
            <th className="border px-4 py-2">Administrative Contact Name</th>
            <th className="border px-4 py-2">Contact Email</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td className="border px-4 py-2">{data?.registrant?.name || 'N/A'}</td>
            <td className="border px-4 py-2">{data?.technicalContact?.name || 'N/A'}</td>
            <td className="border px-4 py-2">{data?.administrativeContact?.name || 'N/A'}</td>
            <td className="border px-4 py-2">{data?.contactEmail || 'N/A'}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default ContactInfoTable;
